import React, { Component } from 'react';
import { Link, withRouter } from "react-router-dom";
import './Navigation';

class Navigation extends Component {
    constructor(props) {
        super(props);
        this.state = { collapsed: true };
    }
    render() {
        return (
            <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
                <Link
                    className={`nav-brand  ${this.props.location.pathname === "/order" ? "active" : ""}`}
                    to="/order">
                    Order
                </Link>
                <button className="navbar-toggler" type="button" onClick={() => this.setState({ collapsed: !this.state.collapsed })}>
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div
                    className={this.state.collapsed ? 'navbar-collapse collapse' : 'navbar-collapse'}
                    id="navbar">
                    <ul className="navbar-nav mr-auto my-2 my-lg-0 navbar-nav-scroll">
                        <li className="nav-item active">
                            <Link
                                className={`nav-link  ${this.props.location.pathname === "/order" ? "active" : ""}`}
                                to="/order">
                                Order
                            </Link>
                        </li>
                        <li className="nav-item">
                            <Link
                                className={`nav-link  ${this.props.location.pathname === "/order" ? "active" : ""}`}
                                to="/order">
                                Order
                            </Link>
                        </li>
                        <li className="nav-item">
                            <Link
                                className={`nav-link  ${this.props.location.pathname === "/order" ? "active" : ""}`}
                                to="/order">
                                Order
                            </Link>
                        </li>
                        <li className="nav-item">
                            <Link
                                className={`nav-link  ${this.props.location.pathname === "/order" ? "active" : ""}`}
                                to="/order">
                                Order
                            </Link>
                        </li>
                    </ul>
                    <form className="d-flex">
                        <input className="form-control mr-2 bg-dark text-light" type="search" placeholder="Search" />
                        <button className="btn btn-outline-primary" type="submit">Search</button>
                    </form>
                </div>
            </nav>
        );
    }
}

export default withRouter(Navigation);
